function grade_performance {
  local lines=$1
  local size=$2
  local grade=""
  local color=""

  if [ "$size" == "100" ]; then
    if [ "$lines" -le 700 ]; then grade="5/5"; color="\033[0;32m"; # Green
    elif [ "$lines" -le 900 ]; then grade="4/5"; color="\033[0;33m"; # Yellow
    elif [ "$lines" -le 1100 ]; then grade="3/5"; color="\033[0;33m"; # Orange
    elif [ "$lines" -le 1300 ]; then grade="2/5"; color="\033[0;31m"; # Red
    elif [ "$lines" -le 1500 ]; then grade="1/5"; color="\033[0;31m"; # Red
    else grade="FAIL"; color="\033[0;31m"; # Red
    fi
  elif [ "$size" == "500" ]; then
    if [ "$lines" -le 5500 ]; then grade="5/5"; color="\033[0;32m"; # Green
    elif [ "$lines" -le 7000 ]; then grade="4/5"; color="\033[0;33m"; # Yellow
    elif [ "$lines" -le 8500 ]; then grade="3/5"; color="\033[0;33m"; # Orange
    elif [ "$lines" -le 10000 ]; then grade="2/5"; color="\033[0;31m"; # Red
    elif [ "$lines" -le 11500 ]; then grade="1/5"; color="\033[0;31m"; # Red
    else grade="FAIL"; color="\033[0;31m"; # Red
    fi
  fi

  echo -e -n "${color}${grade}\033[0m"
}

